import {addUserDetails, addQuestions} from '../redux/actions.js';

export const mapUserStateToProps = (state) => { return {state}};

export const mapUserDispatchToProps = (dispatch) => {return {addUserDetailsToState : (userDetails) => dispatch(addUserDetails(userDetails))}};

export const mapQuestionsStateToProps = (state) => { return {state}};

export const mapQuestionsDispatchToProps = (dispatch) => {return {addQuestions : (questions) => dispatch(addQuestions(questions))}};
